  false,\n\t\"url\": null,\n\t\"notes\": \"These files contain classified topographic
  and bathymetric lidar data as unclassified valid topographic data (1), valid topographic
  data classified as ground (2), low points or noise (7), valid bathymetric data (11).
  Classes 1, 2 and 7 are defined in accordance with the American Society for Photogrammetry
  and Remote Sensing (ASPRS) classification standards, while class 11 is specific
  to the NOAA CSC. These data were collected by the Compact Hydrographic Airborne
  Rapid Total Survey (CHARTS) system along the coast of Michigan and New York. CHARTS
  integrates topographic and bathymetric lidar sensors, a digital camera and a hyperspectral
  imager on a single remote sensing platform for use in coastal mapping and charting
  activities. Data coverage generally extends along the coastline from the waterline
  inland 500 meters (topography) and offshore 1,000 meters or to laser extinction
  (bathymetry). Native lidar data is not generally in a format accessible to most
  Geographic Information Systems (GIS). Specialized in-house and commercial software
  packages are used to process the native lidar data into 3-dimensional positions
  that can be imported into GIS software for visualization and further analysis. Horizontal
  positions, provided in decimal degrees of latitude and longitude, are referenced
  to the North American Datum of 1983 (NAD83). Vertical positions are referenced to
  the NAD83 (GRS80) ellipsoid and provided in meters.The 3-D position data are sub-divided
  into a series of LAS files, each covering approximately 5 kilometers of shoreline.
  LiDAR data was collected at a nominal point spacing (NPS) of 2.0 meters. The format
  of the file is LAS version 1.2.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
